import React,{Component} from 'react';
import './App.css';

class App extends Component
{
  state={
    student:[
      { name: 'Sunil', dept:'IT'},
      { name: 'Umesh', dept:'Computer'}
    ]
  }


  render(){
    return(
    <div className={App}>
      <h1>Day 3 Assignment</h1>

    </div>
    );
  }
}
export default App;
